import Icon from './Icon';
import ThemeProvider from '../../utils/theme';
export default {
  title: 'Icon',
  component: Icon,
  parameters: {
    layout: 'centered'
  },
  tags: ['autodocs'],
  argTypes: {}
};
const icons = {
  // Define your icons here
  AddSvg: React.lazy(() => import('../Icons/AddSvg')),
  AlarmOffSvg: React.lazy(() => import('../Icons/AlarmOffSvg')),
  AlarmOnSvg: React.lazy(() => import('../Icons/AlarmOnSvg')),
  AlarmSemiOffSvg: React.lazy(() => import('../Icons/AlarmSemiOffSvg')),
  ArrowCross1Svg: React.lazy(() => import('../Icons/ArrowCross1Svg')),
  ArrowCross2Svg: React.lazy(() => import('../Icons/ArrowCross2Svg')),
  ArrowDownSvg: React.lazy(() => import('../Icons/ArrowDownSvg')),
  ArrowLeftSvg: React.lazy(() => import('../Icons/ArrowLeftSvg')),
  ArrowRightSvg: React.lazy(() => import('../Icons/ArrowRightSvg')),
  ArrowUpSvg: React.lazy(() => import('../Icons/ArrowUpSvg')),
  BrightnessSvg: React.lazy(() => import('../Icons/BrightnessSvg')),
  CalculatorSvg: React.lazy(() => import('../Icons/CalculatorSvg')),
  CalendarSvg: React.lazy(() => import('../Icons/CalendarSvg')),
  CaretDownSvg: React.lazy(() => import('../Icons/CaretDownSvg'))
};
const Story = () => {
  console.error('icons', icons);
  return <ThemeProvider>
      <Suspense fallback={<div>Loading...</div>}>
        {Object.keys(icons).map(key => {
        const IconComponent = icons[key];
        return <div key={key}>
              <span style={{
            fontSize: '10px',
            color: '#fff'
          }}>{key}</span>
              <IconComponent />
            </div>;
      })}
      </Suspense>
    </ThemeProvider>;
};
